import { useEffect, useState } from "react";

function Hello() {
  useEffect(() => {
    console.log("i'm here");
  }, []);
  return <h1>Hello</h1>;
}
function App() {
  const [todo, setTodo] = useState("");
  const onChange = (event) => setTodo(event.target.value);
  return (
    <div className="App">
      <form>
        <input
          onChange={onChange}
          value={todo}
          type="text"
          placeholder="Write your to do"
        />
      </form>
    </div>
  );
}

export default App;
